import React from "react";

const Menubutton = FilteredTodo => {
  return (
    <div className="optionButton">
      <ul>
        <li>
          <a href="#/" onClick={() => {}}>
            All
          </a>
        </li>
        <li>
          <a href="#/Active">Active</a>
        </li>
        <li
          onClick={() =>
            (FilteredTodo = FilteredTodo.chechecked.filter(e => console.log(e)))
          }
        >
          <a href="#/Complited">Complited</a>
        </li>
      </ul>
    </div>
  );
};
export default Menubutton;
